webpackJsonp([0x81b8806e4260],{342:function(A,e){A.exports={data:{allMarkdownRemark:{edges:[{node:{id:"C:/Users/bensi/OneDrive/Documents/NewSite/Portfolio/src/pages/posts/software/ramdie.md absPath of file >>> MarkdownRemark",html:"<h1>Ram Die</h1>\n<h2>Job Tracker</h2>\n<p>Ram Die is committed to building and servicing tools for several industries that cover a vast range of steel required products such as the: Automotive, Furniture, Appliance, Recreational Vehicle, and Medical fields. Managing all of these products can be an intense process. Ram Die was implementing a scheduling program using Microsoft Excel. Their process was messy, hard to manage, and inefficient. That is when Ram Die came to me to redesign there software as a internal web interface for scheduling and managing processes within the company.</p>\n<h2>Design</h2>\n<p>The design of the project was created to be a simple interface and easy access to CRUD operations within the management panel. The program would be broken down into two main categories. Administration where CRUD operations could be performed on jobs, employees, documents, and customers. The second category would be the Job Tracker. This would be a table that showed all the various fields for a job. It would take date times and display productivity levels based on color coding. The aesthetics of the app would take form in using Bootstrap 4.</p>\n<h2>Development</h2>\n<p>The development of the project took the for of Rapid Application Development (RAD). With that said it was agreed that the web app would be written using ASP.NET Web Forms. Web Forms would allow us to plop all the forms and tables in the application quickly without having to route controllers and models. Another reason is that the site only comprised of 6 pages. The database was a SQLServer express installation. By using Entity Framework Code-First the creation of the database with instantaneous. EF allowed me to focus on the functionality of the job tracker and take a load of writing CRUD operations.</p>\n<p>The Job Tracker page is where most of the magic was. Given certain dates the program would look at the dates and compare them against each other. Depending how the dates aligned the color of the boxes would change to indicate if the job was behind, on time, or ahead of schedule.</p>\n<h2>Gallery</h2>\n<p>Below is the admin panel that is used for CRUD operations on customers, employees, contacts, and jobs. Also pictured is the job tracker page.</p>",frontmatter:{path:"/ram-die",title:"Ram Die",category:"software",featuredText:"The design of the project was created to be a simple interface and easy access to CRUD operations within the management panel.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5815085158150852,src:"/portfolio/static/Ramdie_Featured-4dfc587a7534e9318ed4dd5b66ee3ed1-17ae0.jpg",srcSet:"/portfolio/static/Ramdie_Featured-4dfc587a7534e9318ed4dd5b66ee3ed1-3f4bd.jpg 98w,\n/portfolio/static/Ramdie_Featured-4dfc587a7534e9318ed4dd5b66ee3ed1-231fe.jpg 195w,\n/portfolio/static/Ramdie_Featured-4dfc587a7534e9318ed4dd5b66ee3ed1-17ae0.jpg 390w,\n/portfolio/static/Ramdie_Featured-4dfc587a7534e9318ed4dd5b66ee3ed1-e78f1.jpg 585w,\n/portfolio/static/Ramdie_Featured-4dfc587a7534e9318ed4dd5b66ee3ed1-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}},{node:{id:"C:/Users/bensi/OneDrive/Documents/NewSite/Portfolio/src/pages/posts/ecommerce/reliable-sport.md absPath of file >>> MarkdownRemark",html:"<h1>Reliable Sport</h1>\n<p>Reliable Sport was a fun website for me. It was built in our open source .NET MVC e-commerce platform called NopCommerce. The site was different from other because I was tasked with imported over 200 products into the new system. Reliable sells many items including pool tables, mopeds, arcade systems and many more.</p>",frontmatter:{path:"/reliable",title:"Reliable Sport",category:"e-commerce",featuredText:"AAA is a concrete pouring company who specializes in custom stonework.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.6129032258064515,src:"/portfolio/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-17ae0.jpg",srcSet:"/portfolio/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-3f4bd.jpg 98w,\n/portfolio/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-231fe.jpg 195w,\n/portfolio/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-17ae0.jpg 390w,\n/portfolio/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-e78f1.jpg 585w,\n/portfolio/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}},{node:{id:"C:/Users/bensi/OneDrive/Documents/NewSite/Portfolio/src/pages/posts/wordpress/borculo.md absPath of file >>> MarkdownRemark",html:"<h1>Borculo Wrecker Service</h1>\n<p>Most of the time small business customers don’t want to spend the money to have a website. Who can blame them, depending on the industry they are in and the scale of their business it doesn’t make sense to have an elaborate website. Borculo wrecker is an example of a business who would do better with a single page website that would quick serve up information to the client. This website was simple, clean, responsive, and within budget.</p>",frontmatter:{path:"/borculo",title:"Borculo Wrecker Service",category:"cms",featuredText:"Borculo wrecker is an example of a business who would do better with a single page website that would quick serve up information to the client.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.4460043196544277,src:"/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-de327.png",srcSet:"/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-70ad4.png 98w,\n/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-3a1ad.png 195w,\n/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-de327.png 390w,\n/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-6007d.png 585w,\n/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-3b5b7.png 780w,\n/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-a4793.png 1170w,\n/portfolio/static/Borculo-98907bb22082befab5b6698367464e1d-cbe63.png 1339w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}},{node:{id:"C:/Users/bensi/OneDrive/Documents/NewSite/Portfolio/src/pages/posts/wordpress/vans.md absPath of file >>> MarkdownRemark",html:"<h1>Van’s Car Wash</h1>\n<p>Van’s Car Wash is a local car wash chain serving seven locations across the West Michigan area. Before Vans came to us he had no website. The main objective of the site was to provide the Google location for each car wash across the area, so that’s what I did. The website has all locations and Google iFrames for easy navigation. The biggest priority for the site was for it to be mobile friendly. Most of the users who would be viewing the site would be on their mobile devices.</p>\n<h2>Design</h2>\n<p>I had a lot of fun designing this site and feel that it is clean and sharp. The white background with hints of blue keep the content clean and specific to the content. The mock up was created in Photoshop and once the design was approved I moved to development.</p>\n<h2>Development</h2>\n<p>The site was developed in WordPress. No theme was used to create this site. I used a blank template and started from scratch. There was no blog or post types, so development of the site was primarily kept to HTML, CSS, and Javascript. By using Advances Custom Fields plugin, I was able to make it so the owner could easily come in and swap the coupon pictures out. The purpose of a CMS is to bring ease of use to the client and that is just what Van’s Car Wash does.</p>",frontmatter:{path:"/vans-carwash",title:"Vans Carwash",category:"cms",featuredText:"Van’s Car Wash is a local car wash chain serving seven locations across the West Michigan area.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.2149532710280373,src:"/portfolio/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-17ae0.jpg",srcSet:"/portfolio/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-3f4bd.jpg 98w,\n/portfolio/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-231fe.jpg 195w,\n/portfolio/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-17ae0.jpg 390w,\n/portfolio/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-e78f1.jpg 585w,\n/portfolio/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}},{node:{id:"C:/Users/bensi/OneDrive/Documents/NewSite/Portfolio/src/pages/posts/wordpress/aaa.md absPath of file >>> MarkdownRemark",html:"<h1>AAA Poured Walls</h1>\n<p>AAA is a concrete pouring company who specializes in custom stonework. Their services encompass poured walls, flat work, and decorative concrete. I had a lot of fun with this design and feel it is one of my better designs. The client was happy to showcase their new website, and they were even happier to be able to manage it themselves.</p>",frontmatter:{path:"/aaa",title:"AAA",category:"cms",featuredText:"AAA is a concrete pouring company who specializes in custom stonework.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.1992619926199262,src:"/portfolio/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-17ae0.jpg",srcSet:"/portfolio/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-3f4bd.jpg 98w,\n/portfolio/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-231fe.jpg 195w,\n/portfolio/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-17ae0.jpg 390w,\n/portfolio/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-e78f1.jpg 585w,\n/portfolio/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}}]}},pathContext:{}}}});
